import React from 'react';
import logo from './logo.svg';
import './App.css';

const agents = [
  {'nnAgents':[]},
  {'tradAgents':[]}
]

const Reset = () => {
  return (
    <a href="" onClick={console.log('reset')} id="resetBtn"></a>
  );
}

const Agent = (props) => {
  return (
    <div className="agent">
      <span>{props.nps}</span>
      <p>{props.key}</p>
    </div>
  );
}

const Player = (prop) => {
  return (
      <div className='player'>
          <span className='player-name'>
              {prop.name}
          </span>

          <Counter />
      </div>
  );
}

const Header = (props) => {
  return (
      <header>
          <h1>{props.title}</h1>
          <h2>{props.subtitle}</h2>

          <Reset />

          <div className="supporting">

          </div>
      </header>
  );
}

const App = (prop) => {
  return (
    <div className='scoreboard'>
        <Header title="Call Routing" subtitle="Text" />

        <div id="nn">
        {prop.allAgents.map(e => 
            <Agent key={e.id.toString()} nps={e.nps} />    
        )}
        </div>

        <div id="traditional">
        {prop.allAgents.map(e => 
            <Agent key={e.id.toString()} nps={e.nps} />    
        )}
        </div>

    </div>
  );
}

export default App;
